import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Route exact path="/Orders" component={Orders} />
      <Route exact path="/Orders/new" component={OrderNew} />
    </BrowserRouter>
  );
};

export default App;
